<?php

use Simplon\Helper\DataUri;
use Simplon\Helper\DetectMimeType;

require __DIR__ . '/../vendor/autoload.php';

$file = file_get_contents('https://img.washingtonpost.com/blogs/the-fix/files/2016/12/mask_throw_360.gif');

$blob = DataUri::decode('data:image/jpeg;base64,');
$info = DetectMimeType::getInfo(DetectMimeType::detect($blob));

$fh = fopen('image.' . $info['ext'][0], 'w');
fwrite($fh, $blob);
fclose($fh);